    private boolean cOperador(String token) {
        return token.equals("+") || token.equals("-") || token.equals("*")
                || token.equals("/") || token.equals(">")|| token.equals("==");
    }

   public String coperar(String Izq, String op, String Der) {
        String a = Izq;
        String b = Der;

        switch (op) {
            case "+":
                return "suma "+a+" "+b+" ";
            case "-":
                return "resta "+a+" "+b+" ";
            case "*":
                return "mul "+a+" "+b+" ";
            case "/":
                return "div "+a+" "+b+" ";
            case ">":
                return a+" > "+b+" ";
            case "==":
                return a+" == "+b+" ";    
            default:
                return "false";
        }
    }

